    this.randomCreateItem = function(i,j,k){
        switch(this.mapArray[i][j][k]){
            case 91:
                return new Item_blank();
            case 196:
                return new Item_blank();
            case 200:
                return new Item_blank();
            case 192:
                var random = Math.floor(Math.random()*150);
                if(random == 0 || random == 10 || random == 20)
                    return new Item_sapling();
                else if(random == 11 || random == 12)
                    return new Item_grass();
                else if(random == 50)
                    return new Item_bush();
                else if(random == 60)
                    return new Item_flint();
                else if(random == 70)
                    return new Item_flower();
                else
                    return new Item_blank();
            case 123:
                var random = Math.floor(Math.random()*150);
                if(random == 0 || random == 10 || random == 20 || random == 30)
                    return new Map_item_tree();
                else if(random == 11)
                    return new Item_grass();
                else if(random == 50)
                    return new Item_bush();
                else if(random == 60)
                    return new Item_flint();
                else if(random == 70)
                    return new Item_sapling();
                else
                    return new Item_blank();
            case 137:
                var random = Math.floor(Math.random()*100);
                if(random == 60)
                    return new Item_flint();
                else
                    return new Item_blank();
            case 255:
                var random = Math.floor(Math.random()*200);
                if(random == 10)
                    return new Item_flint();
                else if(random == 11)
                    return new Item_grass();
                else if(random == 50)
                    return new Item_bush();
                else if(random == 60 || random == 90)
                    return new Item_snow_ball();
                else if(random == 70)
                    return new Item_sapling();
                else
                    return new Item_blank();
            default:
                return new Item_blank();
        }
    }
